benchmarks.TimeSuite.time_ECPL.code:
def time_ECPL(self):
    pdist = naima.models.ExponentialCutoffPowerLaw(1e36/u.eV,
            1*u.TeV, 2.7, 50*u.TeV)
    pdist._memoize = False
    for i in range(10):
        pd = pdist(self.energy_g)

